        public string CallModel(string zipcode)
        {
            string column = "";
            string value = "";

            string StAr = ArrayAddress();
            string[] table = StAr.Split('!');
            for (int h = 0; h < table.Length; h++)
            {
                string[] row = table[h].Split(',');
                
                for (int i = 0; i < row.Length; i++)
                {
                    string[] ColVal = row[i].Split(':');
                    if (column != "") { column = column + "<br />"; }
                    column = column + ColVal[0].Replace("\"","") + " = " + ColVal[1].Replace("\"", "");
                    //value = value + ColVal[1];
                }

                column = column + "<br /> -------------------- ";
            }
            return column;
        }
